description:
Return to Saudi Arabia

Sociopolitical Documentary hosted by Frank Gardner, published by BBC in 2013 - English narration


Information
------------------------------

Frank Gardner returns for the first time to Riyadh, the city in Saudi Arabia where he was shot by Al Qaeda in 2004 and left dependent upon a wheelchair. Travelling in this important and mysterious country, he explores how it has so far avoided an Arab Spring revolution.

